@kelseymarie.reads says, "This book. ❤️ I loved how this book started as one thing and then morphed into something much deeper. I really felt so immersed in the ups and downs of Anna’s self discovery journey, and the romance was just the sweetest! Quan was so wonderfully understanding and patient. If you enjoyed the other books in this series, you will LOVE this one."⁠
